import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const CreateLocationPage = () => {
  const [locationName, setLocationName] = useState('');
  const [locationType, setLocationType] = useState('');
  const [address, setAddress] = useState('');
  const [description, setDescription] = useState('');
  const [user, setUser] = useState(JSON.parse(localStorage.getItem('user')));
  const [error, setError] = useState(null);
  const navigate = useNavigate(); // Initialize navigation

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const locationData = {
        locationName,
        locationType,
        address,
        description,
        username: user.username,
      };

      console.log("Sending location data:", locationData);

      const response = await axios.post('http://localhost:8081/api/locations/createLocation', locationData, {
        headers: {
          'Content-Type': 'application/json',
        }
      });

      console.log('Location created:', response.data);

      // Redirect to landing page after successful submission
      navigate('/landingPage');

    } catch (error) {
      console.error('Error creating location:', error);
      setError('Error creating location');
    }
  };

  return (
    <div className="min-h-screen px-6 py-12 bg-inherit text-brunswick font-inknut">
      <div className="max-w-2xl mx-auto bg-asparagus rounded-lg shadow-md p-8">
        <h1 className="text-3xl font-bold mb-8 text-center">Create New Location</h1>

        <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {/* Location Name */}
          <div className="col-span-1 md:col-span-2">
            <label className="block mb-1 font-semibold" htmlFor="locationName">Location Name</label>
            <input
              id="locationName"
              type="text"
              value={locationName}
              onChange={(e) => setLocationName(e.target.value)}
              className="w-full px-4 py-2 border border-alabaster rounded focus:outline-none focus:ring-2 focus:ring-fern"
            />
          </div>

          {/* Location Type */}
          <div>
            <label className="block mb-1 font-semibold" htmlFor="locationType">Location Type</label>
            <input
              id="locationType"
              type="text"
              value={locationType}
              onChange={(e) => setLocationType(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-fern"
            />
          </div>

          {/* Address */}
          <div>
            <label className="block mb-1 font-semibold" htmlFor="address">Address</label>
            <input
              id="address"
              type="text"
              value={address}
              onChange={(e) => setAddress(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-fern"
            />
          </div>

          {/* Description */}
          <div className="col-span-1 md:col-span-2">
            <label className="block mb-1 font-semibold" htmlFor="description">Description</label>
            <textarea
              id="description"
              rows="4"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 rounded resize-none focus:outline-none focus:ring-2 focus:ring-fern"
            />
          </div>

          {/* Submit Button */}
          <div className="col-span-1 md:col-span-2 text-center">
            <button
              type="submit"
              className="bg-fern hover:bg-sage text-white px-6 py-3 rounded font-semibold transition"
            >
              Create Location
            </button>
          </div>
        </form>

        {error && <p className="text-red-600 mt-4 text-center">{error}</p>}
      </div>
    </div>
  );  
};

export default CreateLocationPage;
